/* Install compare page predefined image files */

$installer = $this;
$installer->startSetup();

$baseDir = Mage::getBaseDir('media') . DS . 'comparedto';
$filesData = array(
    array(
        'file_name' => 'wfn-tier1_has_365_days.png',
        'content' => ''
    ),
    array(
        'file_name' => 'wfn-tier1-ribbon-left.png',
        'content' => ''
    ),
    array(
        'file_name' => 'wfn-tier1-ribbon-right.png',
        'content' => ''
    ),
    array(
        'file_name' => 'wfn-oem-ribbon-left.png',
        'content' => ''
    ),
    array(
        'file_name' => 'wfn-oem-ribbon-right.png',
        'content' => ''
    )
);
if (!file_exists($baseDir)) {
    mkdir($baseDir, 0777, true);
}
foreach ($filesData as $fileData) {
    file_put_contents($baseDir . DS . $fileData['file_name'], base64_decode($fileData['content']));
}

$installer->endSetup();

